def maxId(table):
    
    queryId ="select max(id) as max from " + table
    sql = text(queryId)
    result = db.engine.execute(sql)
  
    id= [row for row in result]
    
    if isinstance(id[0][0], int):
        return int(id[0][0])+1
    else:
        return 1

